public class InnerAnalysisDefaultNewSheetConfigurationFactory(Action<Humidifier.QuickSight.AnalysisTypes.DefaultNewSheetConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.QuickSight.AnalysisTypes.DefaultNewSheetConfiguration>
{

    internal InnerAnalysisDefaultInteractiveLayoutConfigurationFactory InteractiveLayoutConfigurationFactory { get; set; }

    internal InnerAnalysisDefaultPaginatedLayoutConfigurationFactory PaginatedLayoutConfigurationFactory { get; set; }

    protected override Humidifier.QuickSight.AnalysisTypes.DefaultNewSheetConfiguration Create()
    {
        var defaultNewSheetConfigurationResult = CreateDefaultNewSheetConfiguration();
        factoryAction?.Invoke(defaultNewSheetConfigurationResult);

        return defaultNewSheetConfigurationResult;
    }

    private Humidifier.QuickSight.AnalysisTypes.DefaultNewSheetConfiguration CreateDefaultNewSheetConfiguration()
    {
        var defaultNewSheetConfigurationResult = new Humidifier.QuickSight.AnalysisTypes.DefaultNewSheetConfiguration();

        return defaultNewSheetConfigurationResult;
    }
    public override void CreateChildren(Humidifier.QuickSight.AnalysisTypes.DefaultNewSheetConfiguration result)
    {
        base.CreateChildren(result);

        result.InteractiveLayoutConfiguration ??= InteractiveLayoutConfigurationFactory?.Build();
        result.PaginatedLayoutConfiguration ??= PaginatedLayoutConfigurationFactory?.Build();
    }

} // End Of Class

